import React from 'react';
import { Typography } from '@material-ui/core';


var sectionStyle = {
    width: "100%",
    height: "400px",
    backgroundImage: "url("`https://images.pexels.com/photos/443383/pexels-photo-443383.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500` + ")"
  };
class HomePage extends React.Component {
    
    render(){
        return(
            <div style = {{ margin: '5rem',width : '100%' }}>
                <Grid
                style = {sectionStyle}
                container
                direction="row"
                justify="center"
                 alignItems="center"
                >

                </Grid>
            </div>

        )
    }

}
export default HomePage;
